var getNumberOfStocks = Class.create();
getNumberOfStocks.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
    getStocks: function() {
        var gr = new GlideRecord('x_1755447_laptop_0_laptop_request');
        gr.addQuery('laptop_model', this.getParameter('sysparm_laptop_model'));
        gr.query();
        if (gr.next()) {
            return gr.stock;
        }
    },
    type: 'getNumberOfStocks'
});
